    public int minSpeedOnTime1(int[] dist, double hour) {
        if (dist.length > Math.ceil(hour)) {
            return -1;
        }
        // 搜索边界
        int left = 1, right = Integer.MAX_VALUE;
        while (left < right) {
            int mid = left + (right - left) / 2;
            // 如果以 mid 速度可达，那么就尝试减小速度
            if (check(dist, hour, mid)) {
                right = mid;
            }
            // 否则就需要加了
            else {
                left = mid + 1;
            }
        }
        return left;
    }

    private boolean check(int[] dist, double hour, int speed) {
        double cnt = 0.0;
        // 对除了最后一个站点以外的时间进行向上取整累加
        for (int i = 0; i < dist.length - 1; ++i) {
            // 除法的向上取整
            cnt += (dist[i] + speed - 1) / speed;
        }
        // 加上最后一个站点所需的时间
        cnt += (double) dist[dist.length - 1] / speed;
        return cnt <= hour;
    }


    /**
     * @Description: 计算最小的速度值
     * @Param: [dist, hour]
     */
    public int minSpeedOnTime(int[] dist, double hour) {
        if (dist == null || dist.length <= 0 || hour <= 0) {
            return -1;
        }
        int sealInt = (int) Math.floor(hour);
        int lenDist = dist.length;
        if (sealInt < lenDist - 1) {
            return -1;
        }
        int left = 1;
        int right = Integer.MAX_VALUE;
        while (left < right) {
            int mid = left + (right - left) / 2;
            double sumHours = timeSum(dist, mid);
            if (sumHours <= hour) {
                right = mid;
            } else {
                left = mid + 1;
            }
        }
        return left;
    }

    private double timeSum(int[] dist, int vMin) {
        int lenDist = dist.length;
        double sumHours = 0;
        for (int i = 0; i < lenDist - 1; i++) {
            // 对除了最后一个站点以外的时间进行向上取整累加
            // 除法的向上取整
            sumHours += (dist[i] + vMin - 1) / vMin;
            //这个向上取整太耗时间了，使用(dist[i] + vMin - 1) / vMin取整更优。
            /*if (dist[i] % vMin == 0) {
                sumHours += dist[i] / vMin;
            } else {
                sumHours += (int) Math.ceil(dist[i] / (double) vMin);
            }*/
        }
        double v = dist[lenDist - 1] / (double) vMin;
        sumHours += v;
        return sumHours;
    }
